import React, {useEffect} from 'react'
import Header from './Header';
import Info from './Info';
import Albumsp from './Albumsp';
import Tracksp from './Tracksp';
import styled from '@emotion/styled'

const Landing = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div>
      <Header />
      <Info />
      <Albumsp />
      <Tracksp />
    </div>
  )
}

export default Landing
